//嬾悪麗 "能"
//竃笥   "竃"
//黍繁   "麹"
//螺社   "厘"

void CreateMap(Maps& map, int index) //幹秀map1
{
	for (int y = 0; y < Len; y++)
	{
		for (int x = 0; x < Len; x++)
		{
			if (MAP[index][y][x] == "能")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Obstacle>(CharLen * x, CharLen * y));
			}
			else if(MAP[index][y][x] == "竃")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Exit>(CharLen * x, CharLen * y));
			}
			else if (MAP[index][y][x] == "麹")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Enemy>(CharLen * x, CharLen * y));
			}
			else if (MAP[index][y][x] == "厘")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Player>(CharLen * x, CharLen * y));
			}
			else if (MAP[index][y][x] == "衛")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Coin>(CharLen * x, CharLen * y));
			}
			else if (MAP[index][y][x] == "埒")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Key>(CharLen * x, CharLen * y));
			}
			else if (MAP[index][y][x] == "壇")
			{
				map.MapPoint.push_back(std::make_unique<Maps::Door>(CharLen * x, CharLen * y));
			}
			      
		}


	}
}

